import { useRoutes } from 'react-router-dom'
import { Error404 } from '../pages/Error404'
import { Home } from '../pages/Home'
import { Rooms } from '../pages/Rooms'
import { Amenities } from '../pages/Amenities'
import { Gallery } from '../pages/HoGalleryme'
import { Contact } from '../pages/Home'
import { Reservations } from '../pages/Home'


const allRoutes = () => {
    const routes = [
        {
            path:"/",
            exact: true,
            element: <Home />
        },
        {
            path:"/home",
            exact: true,
            element: <Home />
        },
        {
            path:"/rooms",
            exact: true,
            element: <Rooms />
        },
        {
            path:"/room/:type",
            exact: true,
            element: <Home />
        },
        {
            path:"/amenities",
            exact: true,
            element: <Amenities />
        },
        {
            path:"/gallery",
            exact: true,
            element: <Gallery />
        },
        {
            path:"/contact",
            exact: true,
            element: <Contact />
        },
        {
            path:"/booking",
            exact: true,
            element: <Reservations />
        },

        {
            path:"/*",
            exact: false,
            element: <Error404 />
        },
    ]
  return [ ...routes ]
}

export const Router = () => {
    const appRoutes = allRoutes()
    return useRoutes(appRoutes);
}
